<div class="ne elHeadline lh3 elMargin0 elBGStyle0 hsTextShadow0 hsSize27" style="text-align: left; color: rgb(50, 50, 50);" data-bold="inherit" contenteditable="false">So on this page were going to give you a crash course in the art of buying low, selling HIGH..<br><br>Let's Do IT!!<br><br>I never knew I would hit it big, but the concept is simple.. we are all sitting on an opportunity like no other..<br><br>INTERNET REAL ESTATE for PENNIES and then sell for dollars.<br><br>Whether you are a domain investor, webmaster or business owner, I've got something for you.<br><br>The hard part? You've got to find them..<br><br>Then once you've got one, you buy it for $9.00 and you start an auction.. the idea is to sell it for many more times than you bought it for..<br><br>I try to get something up every week but I'm always busy playing music..<br><br>If you work hard finding them.. it's easy to sell them.<br><br>It would be hard to sell them if you make it easy to find them.<br><br>See.. traditional investing meant that you bet on the future growth of what you were investing in, <br>but I've always seen certain types of domain names as already holding more value than they can be obtained for.<br><br>For instance, I sell a lot of domain names myself for the appraised value to collectors, investors and webmasters that value the domain name even higher than the appraisal. But I always buy them for the basic cost when they become available.<br><br>You thought all the valuable domain names were taken..<br><br>You know, the types of domain names that would attract a frenzy of bidders to your auction on any of the domain marketplaces seem virtually unattainable.<br><br>The types of domain names that are appraised at $10,000, $20,000 and up, you would think are absolutely unavailable for $9.00 on GoDaddy.<br>
