<div class="ne elHeadline lh3 elMargin0 elBGStyle0 hsTextShadow0 hsSize27" style="text-align: left; color: rgb(42, 42, 42);" data-bold="inherit" contenteditable="false">Well then how did I obtain Violentfights.com, or Financingvehicle.com for $9.00 on GoDaddy?<br><br>How did I sell $400,000 worth of domain names on Flippa?<br><br>Finding a domain name that's available to purchase for $9.00 and then turning around and selling it for $9,000 is NOT easy.<br><br>For instance a domain like basketballcourt.com<br><br>They're out there, but I went automated from manual about a year ago.<br><br>I used to search all night… Id start with a list, and I would scour the web..<br><br>Id appraise, look down the list of availables and grab them up, then drop them on the marketplaces and watch them sell for more than I bought them for..<br><br>When you are scouring, the one thing that you WISH you had was a list generator.. a button you could press, appraisal, the whole nine years all hooked together so you weren't going back &amp; forth, getting eye strain..<br><br>I mean you know the reward is significant.. selling your first domain is amazing. The lump sum payment.. Nothing like that.<br><br>But the process to find them is strenuous, it really is like you are MINING for GOLD.<br>
